    PrintService.prototype.getInvoicePrint = function (data, conf) {
        var documentDef = this.cloner(this.docDef);
        var config = this.cloner(conf || this.defSettings.casesheet);
        // settings up the page properties
        documentDef.pageSize = config.pageSettings.pageSize;
        documentDef.pageOrientation = config.pageSettings.pageOrientation;
        documentDef.pageMargins = this.cloner(config.pageSettings.margins);
        this.setUpStyle(documentDef, config);
        if (config.hzHeader.isHeaderRequired) {
            if (config.hzHeader.isFirstPageOnly) {
                documentDef.content.push(this.getInvoiceHeader(data, config));
            }
            else {
                // need to adjust margin to account for header height
                documentDef.header = this.getInvoiceHeader(data, config);
                if (config.hzHeader.isTextRequired) {
                    documentDef.pageMargins[1] += 180;
                }
                else {
                    documentDef.pageMargins[1] += 160;
                }
            }
        }
        documentDef.content.push(this.getInvoiceTable(data.tableData));
        documentDef.content.push(this.getInvoiceSummary(data, false)); // only needed in invoice
        var amtInWords = data.dueCollection ? 'Amount Paid In Words' : 'Amount In Words';
        documentDef.content.push({
            stack: [
                { text: [{ text: amtInWords + ": ", bold: true }, { text: data.totAmtInWords }] },
                { text: [{ text: 'Payment Mode: ', bold: true }, { text: data.paymentMode }] }
            ],
            color: '#444',
            fontSize: 9
        });
        documentDef.content.push(this.getSignature(data)); // only needed in invoice
        if ((config.footer.footerBannerImage || config.footer.footerText) && config.footer.isFooterRequired) {
            if (config.footer.isLastPageOnly) {
                documentDef.content.push(this.getPageFooter(data, config));
            }
            else {
                documentDef.footer = this.getPageFooter(data, config);
                if (config.footer.isTextRequired) {
                    documentDef.pageMargins[3] += 12;
                }
                else {
                    documentDef.pageMargins[3] += 50;
                }
            }
        }
        this.pdfMake.createPdf(documentDef).print();
    };
    PrintService.prototype.getOpthoPrint = function (opthoData) {
        var _this = this;
        var eyeExamData, glassBean, refractionBean, glassrxTable, autoRefraction, iopTable = [], visionTable = [];
        var doctorSpecialityName = opthoData.doctorSpecialityName;
        var loggedUser = this.userService.getUser();
        var titleCase = this.utilService.toTitleCase;
        var printData = {};
        eyeExamData = this.eyeExamCodes.reduce(function (acc, val) {
            var field = _this.eyeExamCodes.find(function (_field) { return _field.id === val.typeId; });
            if (field) {
                acc[field.modelName] = {
                    od: val.rightEye || '',
                    os: val.leftEye || '',
                    comments: val.remarks || ''
                };
            }
            return acc;
        }, {});
        glassBean = opthoData.glassBean || {};
        // glass rx
        glassrxTable = [
            ['Type', 'Sph', 'Cyl', 'Axis', 'VA', 'Type', 'Sph', 'Cyl', 'Axis', 'VA'],
            [
                'Right Dist',
                glassBean.distanceRightSph || '',
                glassBean.distanceRightCyl || '',
                glassBean.distanceRightAxis || '',
                glassBean.distanceRightVa || '',
                'Left Dist',
                glassBean.distanceLeftSph || '',
                glassBean.distanceLeftCyl || '',
                glassBean.distanceLeftAxis || '',
                glassBean.distanceLeftVa || ''
            ],
            [
                'Right Near',
                glassBean.nearRightSph || '',
                '',
                '',
                glassBean.nearRightVa || '',
                'Left Near',
                glassBean.nearLeftSph || '',
                '',
                '',
                glassBean.nearLeftVa || ''
            ]
        ];
        printData.glassRxDetails = {};
        // glass rx details
        if (glassBean.cont) {
            printData.glassRxDetails.const = glassBean.cont ? 'Yes' : 'No';
        }
        if (glassBean.bifocal) {
            printData.glassRxDetails.bifocal = glassBean.bifocal ? 'Yes' : 'No';
        }
        if (glassBean.arc) {
            printData.glassRxDetails.arc = glassBean.arc ? 'Yes' : 'No' || false;
        }
        if (glassBean.photosun) {
            printData.glassRxDetails.photosun = glassBean.phontosun
                ? 'Yes'
                : 'No' || false;
        }
        if (glassBean.near) {
            printData.glassRxDetails.near = glassBean.near ? 'Yes' : 'No' || false;
        }
        if (glassBean.ipd) {
            printData.glassRxDetails.ipd = (glassBean.ipd || '') + ' mm';
        }
        if (glassBean.glassTypeAdvice) {
            printData.glassRxDetails.glassTypeAdvice =
                glassBean.glassTypeAdvice || '';
        }
        if (glassBean.progressive) {
            printData.glassRxDetails.progressive = glassBean.progressive
                ? 'Yes'
                : 'No' || false;
        }
        // iop table
        if (opthoData.iopList) {
            iopTable = opthoData.iopList.map(function (val) {
                return [
                    _this.moment(val.iopTm || '', 'DD/MM/YYYY'),
                    val.iopMethod || '',
                    val.iopRight || '',
                    val.iopLeft || ''
                ];
            });
        }
        iopTable.unshift(['IOP Time', 'Method', 'OD', 'OS']);
        // vision table
        if (opthoData.visionList) {
            visionTable = opthoData.visionList.map(function (val) {
                return [
                    val.visionType || '',
                    val.distanceRightEye || '',
                    val.nearRightEye || '',
                    val.distanceLeftEye || '',
                    val.nearLeftEye || ''
                ];
            });
        }
        visionTable.unshift([
            'Vision',
            'RE(Dist)',
            'RE(Near)',
            'LE(Dist)',
            'LE(Near)'
        ]);
        // date generated
        printData.dateGenerated = this.moment(new Date(), 'DD-MM-YYYY - hh: mm a');
        // doctor specialization
        printData.doctorSpecialization = (doctorSpecialityName || '').toUpperCase();
        // companyName
        printData.companyName = titleCase(this.utilService.getCurrentOrgName(loggedUser));
        // company address
        printData.companyAddress = [
            (loggedUser.orgInfo.addressOne
                ? titleCase(loggedUser.orgInfo.addressOne) + ', '
                : '') +
                (loggedUser.orgInfo.city
                    ? titleCase(loggedUser.orgInfo.city) + ', '
                    : ''),
            (loggedUser.orgInfo.state
                ? titleCase(loggedUser.orgInfo.state) + ', '
                : '') + titleCase(loggedUser.orgInfo.country)
        ];
        printData.tokenNo = opthoData.tokenNo || '';
        // eye examination table
        printData.eyeExamination = eyeExamData;
        // patient details
        printData.patientDetails = {
            patientName: opthoData.patientName || '',
            patientId: opthoData.patientId || '',
            age: opthoData.age || opthoData.dateOfBirth || '',
            gender: opthoData.gender || '',
            mobile: opthoData.mobile || ''
        };
        printData.patientAddress = opthoData.patientAddress || [];
        // doctor details
        printData.doctorDetails = {
            name: opthoData.consultantDoc || opthoData.doctorName || '',
            referredBy: opthoData.referredBy || '',
            visitNo: opthoData.visitNo || '',
            deptName: opthoData.deptName || opthoData.doctorSpecialityName || '',
            paymentApplicable: opthoData.paymentApplicable || ''
        };
        // initial assessment
        printData.initialAssessment = {
            vitals: {
                pulse: opthoData.pulseRate || '',
                bpDys: opthoData.bloodPressureDystolic || '',
                bpSys: opthoData.bloodPressureSystolic || '',
                temp: opthoData.temperatureNomenlature || '',
                resp: opthoData.respiratoryRate || ''
            },
            // generalExamination: opthoData.generalExamination || '',
            cheifComplaints: opthoData.cheifComplaints || '',
            systematicExamination: {
                cvs: opthoData.cardiovascularSystemStatus || '',
                abd: opthoData.gastrointestinalSystemStatus || '',
                respiration: opthoData.respiratorySystemStatus || '',
                cns: opthoData.cranialNervesStatus || '',
                genitoUrinarySystemStatus: opthoData.genitoUrinarySystemStatus || '',
                generalExamination: opthoData.generalExamination || '',
                localExamStatus: opthoData.localExamStatus || ''
            },
            occularDetails: {
                vision: []
            },
            iop: []
        };
        printData.validUpto = opthoData.validUpto || '';
        // glass rx
        printData.glassRx = glassrxTable;
        // final diagnosis
        printData.finalDiagnosis = opthoData.finalDiagnosis || '';
        // investigation
        printData.investigation = [];
        if (opthoData.keyInvestigations) {
            printData.investigation = opthoData.keyInvestigations
                .split(',')
                .map(function (val) { return val.split(':'); })
                .map(function (val) { return [val[0] || '-', val[1] || '-']; });
        }
        refractionBean = opthoData.refractionBean || {};
        autoRefraction = opthoData.autoRefractionBean || {};
        // occular details
        printData.occularDetails = {
            iop: iopTable,
            vision: visionTable,
            refraction: {
                dialated: {
                    re: {
                        dist: {
                            sph: refractionBean.distanceRightSph || '',
                            cyl: refractionBean.distanceRightCyl || '',
                            axis: refractionBean.distanceRightAxis || '',
                            va: refractionBean.distanceRightVa || ''
                        },
                        near: {
                            sph: refractionBean.nearRightSph || '',
                            cyl: '',
                            axis: '',
                            va: refractionBean.nearRightVa || ''
                        }
                    },
                    le: {
                        dist: {
                            sph: refractionBean.distanceLeftSph || '',
                            cyl: refractionBean.distanceLeftCyl || '',
                            axis: refractionBean.distanceLeftAxis || '',
                            va: refractionBean.distanceLeftVa || ''
                        },
                        near: {
                            sph: refractionBean.nearLeftSph || '',
                            cyl: '',
                            axis: '',
                            va: refractionBean.nearLeftVa || ''
                        }
                    }
                },
                undialated: {
                    re: {
                        dist: {
                            sph: refractionBean.undilatedDistanceRightSph || '',
                            cyl: refractionBean.undilatedDistanceRightCyl || '',
                            axis: refractionBean.undilatedDistanceRightAxis || '',
                            va: refractionBean.undilatedDistanceRightVa || ''
                        },
                        near: {
                            sph: refractionBean.undilatedNearRightSph || '',
                            cyl: '',
                            axis: '',
                            va: refractionBean.undilatedNearRightVa || ''
                        }
                    },
                    le: {
                        dist: {
                            sph: refractionBean.undilatedDistanceLeftSph || '',
                            cyl: refractionBean.undilatedDistanceLeftCyl || '',
                            axis: refractionBean.undilatedDistanceLeftAxis || '',
                            va: refractionBean.undilatedDistanceLeftVa || ''
                        },
                        near: {
                            sph: refractionBean.undilatedNearLeftSph || '',
                            cyl: '',
                            axis: '',
                            va: refractionBean.undilatedNearLeftVa || ''
                        }
                    }
                }
            },
            autoRefraction: {
                dialated: {
                    re: {
                        sph: autoRefraction.dilatedRightSph || '',
                        cyl: autoRefraction.dilatedRightCyl || '',
                        axis: autoRefraction.dilatedRightAxis || '',
                        va: autoRefraction.dilatedRightVa || ''
                    },
                    le: {
                        sph: autoRefraction.dilatedLeftSph || '',
                        cyl: autoRefraction.dilatedLeftCyl || '',
                        axis: autoRefraction.dilatedLeftAxis || '',
                        va: autoRefraction.dilatedLeftVa || ''
                    }
                },
                undialated: {
                    re: {
                        sph: autoRefraction.undilatedRightSph || '',
                        cyl: autoRefraction.undilatedRightCyl || '',
                        axis: autoRefraction.undilatedRightAxis || '',
                        va: autoRefraction.undilatedRightVa || ''
                    },
                    le: {
                        sph: autoRefraction.undilatedLeftSph || '',
                        cyl: autoRefraction.undilatedLeftCyl || '',
                        axis: autoRefraction.undilatedLeftAxis || '',
                        va: autoRefraction.undilatedLeftVa || ''
                    }
                }
            }
        };
        printData.eyeComments = [];
        opthoData.eyeDetailsList = opthoData.eyeDetailsList || [];
        if (opthoData.eyeDetailsList[0] &&
            opthoData.eyeDetailsList[0].fieldImageInfo) {
            opthoData.eyeDetailsList[0].fieldImageInfo.forEach(function (val) {
                printData.eyeComments.push(val.comment);
            });
        }
        printData.treatmentAdvised = opthoData.printTreatmentAdviceList || [];
        if (opthoData.planSurgeryDate) {
            printData.planSurgeryDate = this.moment(opthoData.planSurgeryDate, 'DD-MM-YYYY');
        }
        else {
            printData.planSurgeryDate = '';
        }
        if (printData.visitDate) {
            printData.visitDate = this.moment(opthoData.visitDate, 'DD-MM-YYYY');
        }
        else {
            printData.visitDate = '';
        }
        // profile logo
        printData.profileLogo = opthoData.profileLogo;
        // patient image
        printData.patientImage = opthoData.patientImage;
        // eye diagram
        printData.eyeDiagram = opthoData.eyeDiagram;
        this._getOpthoPrint(printData);
    };
